    [],nt"num_tags": 6,nt"name": "euphorbia-esula-achieving-management-objectives-analysis-of-2000-data",nt"isopen":
    false,nt"url": null,nt"notes": "In spring 2000, we continued to assess
    the ecological impacts of the invasive non-native species Euphorbia esula (leafy
    spurge) on rangeland and natural areas in the northern Great Plains, and to evaluate
    the status of biocontrol insects released to reduce spurge populations. In 1998,
    permanent plots were established to monitor changes in the plant community, biocontrol
    population levels, and soil nutrient status over time. Overall goals of the study
    are to quantify the response of biocontrol agents, native and non-native species,
    and soil nutrient availability to varying management strategies.  Results showed
    that the sites not only vary in the amount of leafy spurge infesting them, but also
    in the factors that may control the level of infestation.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
